import React, { useState, useEffect } from 'react';
import './notifications.css';
import { Link, useLocation } from 'react-router-dom';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell } from '@fortawesome/free-solid-svg-icons';

const Notifications = () => {
    const [notifications, setNotifications] = useState([]);
    const [isNavActive, setIsNavActive] = useState(false);

    const location = useLocation();
    const { data } = location.state || {};

    const toggleNav = () => {
        setIsNavActive(!isNavActive);
    };

    useEffect(() => {
        const fetchNotifications = async () => {
            try {
                if (data) {
                    const response = await axios.get(`http://localhost:5000/getNotifications/${data}`);
                    setNotifications(response.data);
                }
            } catch (error) {
                console.error('Error fetching notifications:', error);
            }
        };

        if (data) {
            fetchNotifications();
        }
    }, [data]);

    return (
        <>
            <nav className="navbar">
                <div className="logo">
                    <h1 style={{ fontFamily: "Georgia, 'Times New Roman', Times, serif", fontSize: '27px' }}>
                        SkillBridge
                    </h1>
                </div>
                <div className="nav-right">
                    <ul className={`nav-links ${isNavActive ? 'active' : ''}`} id="navLinks">
                        <li><Link to="/AHome">Home</Link></li>
                        <li><Link to="/myworks">My Works</Link></li>
                        <li><Link to="/shorts">Shorts</Link></li>
                        <li><Link to="/services">Services</Link></li>
                        <li>
                            <Link to="/notifications">
                                <FontAwesomeIcon icon={faBell} /> {/* Notification icon */}
                            </Link>
                        </li>
                    </ul>
                    <div className="profile">
                        <img
                            src="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_960_720.png"
                            alt="Profile"
                            className="profile-img"
                        />
                    </div>
                    <div className="hamburger" id="hamburger" onClick={toggleNav}>
                        <span className="bar"></span>
                        <span className="bar"></span>
                        <span className="bar"></span>
                    </div>
                </div>
            </nav>
            <div className="Notifications-container">
                <ul>
                    {notifications.length > 0 ? (
                        notifications.map((notification) => (
                            <li key={notification._id} className="notification-item">
                                <p><strong>Hand Type:</strong> {notification.handType}</p>
                                <p><strong>Number of Hands:</strong> {notification.numberOfHands}</p>
                                <p><strong>Address:</strong> {notification.address}</p>
                                <p><strong>Start Time:</strong> {new Date(notification.startTime).toLocaleString()}</p>
                                <p><strong>End Time:</strong> {new Date(notification.endTime).toLocaleString()}</p>
                                <p><strong>Total Price:</strong> ${notification.totalPrice}</p>

                                <div className="notification-buttons">
                                    <button className="accept-button">
                                        Accept
                                    </button>
                                    <button className="reject-button">
                                        Reject
                                    </button>
                                </div>
                            </li>
                        ))
                    ) : (
                        <p>No notifications available</p>
                    )}
                </ul>
            </div>
        </>
    );
};

export default Notifications;
